        private static string GetFansCounts(string uid)
        {
            string bilijson = Utils.HttpGet("https://api.bilibili.com/x/relation/followers?vmid=" + uid);

            JObject jo = JObject.Parse(bilijson);

            return ((JObject)jo["data"])["total"].ToString();
        }





